import React from "react";
import "./account.css";

export default function Account() {
  const [tab, setTab] = useState();
  return (
    <>
      <div className="page">
        <h1 className="heading">Account</h1>
        <div className="accountDetails">
          <p>
            <b>Name: </b>Badr Afridi
          </p>
          <p>
            <b>Account status: </b>Buyer and Seller
          </p>
        </div>
        <div className="tab">
          <div
            className="tabs"
            onClick={() => {
              setTab("allattendences");
            }}
          >
            <h4>All Attendances</h4>
          </div>
          <div
            className="tabs"
            onClick={() => {
              setTab("addnewattendence");
            }}
          >
            <h4>Add New Attendance</h4>
          </div>
        </div>
      </div>
    </>
  );
}
